import React, { useState, useEffect } from 'react';
import './wazuh.css';

function convert(date) {
  const newDate = new Date(date);
  const newDate2 = new Date(date);
  const options = {
    day: 'numeric',
    month: 'numeric',
    year: 'numeric',
  };

  const options2 = {
    hour: 'numeric',
    minute: 'numeric',
    hour12: true,
  };

  const array = [
    newDate.toLocaleDateString(undefined, options),
    newDate2.toLocaleTimeString(undefined, options2),
  ];
  console.log(array);
  return array;
}


const WazuhCombined = () => {
    const [data, setData] = useState({
      active: {
        total_count: 0,
        affected_items: [],
        counter: 0,
      },
      inactive: {
        total_count: 0,
        affected_items: [],
        counter: 0,
      },
      disconnected: {
        total_count: 0,
        affected_items: [],
        counter: 0,
      },
    });
  
    useEffect(() => {
      fetchData('get-active_count', 'active');
      fetchData('get-inactive_count', 'inactive');
      fetchData('get-disconnected_count', 'disconnected');
    }, []);
  
    const fetchData = async (endpoint, key) => {
      try {
        const response = await fetch(`http://localhost:3001/${endpoint}`);
        const responseData = await response.json();
  
        // Update the counter based on the total count of affected items
        setData((prevData) => ({
          ...prevData,
          [key]: {
            ...prevData[key],
            ...responseData.data,
            counter: prevData[key].counter + prevData[key].affected_items.length + 1,
          },
        }));
      } catch (error) {
        console.error(error);
      }
    };
  
    return (
      <>
        <table className='table table-info'>
          <thead>
            <tr>
              <th>S.No</th>
              <th>OS</th>
              <th>Agent Name</th>
              <th>IP</th>
              <th className=''>Date</th>
              <th className=''>Time</th>
              <th className=''>Status</th>
            </tr>
          </thead>
          <tbody>
            {data.active.affected_items.map((item, index) => (
              <tr key={index}>
                <td>{data.active.counter + index}</td>
                <td>{item.os_name}</td>
                <td>{item.agent_name}</td>
                <td>{item.registerIP}</td>
                <td className=''>{convert(item.dateAdd)[0]}</td>
                <td className=''>{convert(item.dateAdd)[1]}</td>
                <td className=''>Active</td>
              </tr>
            ))}
            {data.inactive.affected_items.map((item, index) => (
              <tr key={index}>
                <td>{data.inactive.counter + index}</td>
                <td>{item.os_name}</td>
                <td>{item.agent_name}</td>
                <td>{item.registerIP}</td>
                <td className=''>{convert(item.dateAdd)[0]}</td>
                <td className=''>{convert(item.dateAdd)[1]}</td>
                <td className=''>Inactive</td>
              </tr>
            ))}
            {data.disconnected.affected_items.map((item, index) => (
              <tr key={index}>
                <td>{data.disconnected.counter + index}</td>
                <td>{item.os_name}</td>
                <td>{item.agent_name}</td>
                <td>{item.registerIP}</td>
                <td className=''>{convert(item.dateAdd)[0]}</td>
                <td className=''>{convert(item.dateAdd)[1]}</td>
                <td className=''>Disconnected</td>
              </tr>
            ))}
          </tbody>
        </table>
      </>
    );
  };
  

export default WazuhCombined;
